import React from "react";
import ReactDOM from "react-dom";

import App from "./App";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  rootElement
);

function Hello() {
    const sayHello = () =>{
        console.log('hello');
}
return(
    <div>
        <button onClick={sayHello()}>Hello</button>
    </div>
)
  };

  export default Hello
